    function trigger_iteration() {
        // Recursive function to iterate through grouped objects
        function iterateItems(items, action) {
            for (var k = 0; k < items.length; k++) {
                var currentItem = items[k];
                if (currentItem.typename === "GroupItem") {
                    iterateItems(currentItem.pageItems, action); // Recursively check inside groups
                } else {
                    action(currentItem); // Apply action to the current item
                }
            }
        }
    
        switch (true) {
            case (selectedObject instanceof TextFrame):
                // Copy the contents of the selected TextFrame
                var current_text = selectedObject.contents;
                // Iterate through all layers
                for (var i = 0; i < doc.layers.length; i++) {
                    var currentLayer = doc.layers[i];
                    // Iterate through all page items in the layer using the recursive function
                    iterateItems(currentLayer.pageItems, function (currentItem) {
                        // Check if the page item's name matches target_objects
                        if (currentItem.name === target_objects) {
                            // Replace text with current_text
                            currentItem.contents = current_text;
                            objectCounter++;
                        }
                    });
                }
                break;
    
            case (selectedObject instanceof PlacedItem):
                // Handle PlacedItem
                // Iterate through all layers
                for (var i = 0; i < doc.layers.length; i++) {
                    var currentLayer = doc.layers[i];
                    // Iterate through all page items in the layer using the recursive function
                    iterateItems(currentLayer.pageItems, function (currentItem) {
                        if (currentItem.name === target_objects) {
                            // Replace the file with the selected object's file
                            currentItem.file = selectedObject.file;
                            objectCounter++;
                        }
                    });
                }
                break;
    
            default:
                break;
        }
    }
    























